import React from 'react';


const Process = () => {
  return (
    <div className="process">
      <div className="container">
        <h2>Recruitment Process</h2>
        <div className="items row justify-content-center">
          {items.map((item, idx) => {
            return (
              <div key={idx} className="item position-relative m-md-4 col-12 col-md-4">
                <span>{item.icon}</span>
                <h1 className="display-1 position-absolute">
                  {item.num}
                </h1>
                <p>{item.title}</p>
              </div>
            )
          })}
        </div>
      </div>
    </div>
  );
}


export default Process;


const items= [
  {num: 1, icon: "", title: "Send us your resume"},
  {num: 2, icon: "", title: "Interview"},
  {num: 3, icon: "", title: "Technical Skills Check"},
  {num: 4, icon: "", title: "Offer"},
]
